import React, { useState, useEffect, useRef } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { selectFilteredVerbs, selectShufflesIds } from './../app/verbsSlice'
import QuestionBox from './QuestionBox';
import _ from 'lodash'

const Test = (props) => {
   const { displayQuestion } = props
   // const dispatch = useDispatch();
   const filteredVerbs = useSelector(selectFilteredVerbs)
   const questionIdArray = useSelector(selectShufflesIds)

   const isFirstRender = useRef(true)
   const onFirstRender = () => isFirstRender.current = false



   useEffect(() => onFirstRender, []);

   return (
      <div id='test'>
         <QuestionBox questionIdArray={questionIdArray} filteredVerbs={filteredVerbs} displayQuestion={displayQuestion} />
      </div>
   )
}

export default Test
